import React, {useState} from 'react';
import {Jumbotron as Jumbotrons, Button} from 'reactstrap';

const Jumbotron = (props) => {
    const [learnMore, setLearnMore] = useState(false)
    return (
        <div>
            <Jumbotrons>
                <h1 className="display-3">Hello guests!</h1>
                <p className="lead">We are always happy to welcome our guests, we offer you the development of the
                    map.</p>
                <hr className="my-2"/>
                <p className="lead">
                    <Button color="primary"
                            onClick={setLearnMore(!learnMore)}>Learn More</Button>
                </p>
                {
                    learnMore ?
                        <p>an international free website, an online geographic encyclopedia that aims to mark and
                            describe all geographic features on Earth.</p>
                        : <p>
                            an international free website, an online geographic encyclopedia whose purpose is to mark and
                            describe all geographic features on Earth. Wikimapia combines an interactive map with the free
                            editing principle of a wiki. The project was founded by Alexander Koryakin and Evgeny Savelyev
                            on May 24, 2006. Now more than 2.4 million users are registered on Wikimapia and more than 30
                            million objects have been added to the map (excluding subsequently deleted ones). All Wikimapia
                            data is available for general use under the Creative Commons Attribution-ShareAlike 3.0 license.
                            The slogan of the project: "Let's describe the whole world!" (Letâ€™s describe the whole world!)
                            Is listed in the title of the site.
                        </p>
                }
            </Jumbotrons>
        </div>
    );
};

export default Jumbotron;
